import React from 'react';
import { useAppContext } from '../context/AppContext';
import './WalletList.css';

// Mock data for wallets
const MOCK_WALLETS = [
  { id: 1, address: '0x9996..9099', balance: 9.6399, selected: true },
  { id: 2, address: '0x33b6..b433', balance: 0.0000, selected: true },
  { id: 3, address: '0x696a..cc69', balance: 5.6284, selected: true },
  { id: 4, address: '0x6664..3866', balance: 5.5618, selected: false },
];

function WalletList() {
  const { 
    wallets, 
    toggleWalletSelection, 
    isLoadingWallets, 
    walletError, 
    fetchWalletBalances, 
    importWallet, 
    isImportingWallet, 
    newWalletImport, 
    handleWalletImportChange 
  } = useAppContext();

  const handleImportSubmit = async (e) => {
    e.preventDefault();
    if (!newWalletImport.privateKey) {
      alert('Please enter a private key.');
      return;
    }
    await importWallet(newWalletImport.privateKey, newWalletImport.nickname);
  };

  return (
    <div className="wallets-container">
      <div className="wallets-header">
        <h2>Wallets</h2>
        <button onClick={fetchWalletBalances} disabled={isLoadingWallets} className="refresh-btn">
          {isLoadingWallets ? 'Refreshing...' : 'Refresh Balances'}
        </button>
      </div>

      {walletError && <div className="wallet-error">Error: {walletError}</div>}

      {/* Import Wallet Form */}
      <form onSubmit={handleImportSubmit} className="import-wallet-form">
        <h3>Import New Wallet</h3>
        <div className="form-group">
          <label htmlFor="privateKey">Private Key:</label>
          <input
            type="password" // Use password type to hide key
            id="privateKey"
            value={newWalletImport.privateKey}
            onChange={(e) => handleWalletImportChange('privateKey', e.target.value)}
            placeholder="0x..."
            required
            disabled={isImportingWallet}
          />
        </div>
        <div className="form-group">
          <label htmlFor="nickname">Nickname (Optional):</label>
          <input
            type="text"
            id="nickname"
            value={newWalletImport.nickname}
            onChange={(e) => handleWalletImportChange('nickname', e.target.value)}
            placeholder="My Wallet 1"
            disabled={isImportingWallet}
          />
        </div>
        <button type="submit" disabled={isImportingWallet || !newWalletImport.privateKey} className="import-btn">
          {isImportingWallet ? 'Importing...' : 'Import Wallet'}
        </button>
      </form>

      {/* Wallet List */}
      <h3>Available Wallets</h3>
      <div className="wallet-list">
        <div className="wallet-list-header">
          <div className="wallet-checkbox-header">Select</div>
          <div className="wallet-address-header">Address</div>
          <div className="wallet-balance-header">Balance (MON)</div>
        </div>
        
        {wallets.length === 0 && !isLoadingWallets && (
          <div className="wallet-item">No wallets imported yet.</div>
        )}
        
        {wallets.map(wallet => (
          <div key={wallet.id} className="wallet-item">
            <div className="wallet-checkbox">
              <input 
                type="checkbox" 
                checked={wallet.selected} 
                onChange={() => toggleWalletSelection(wallet.id)}
                id={`wallet-${wallet.id}`}
              />
              <label htmlFor={`wallet-${wallet.id}`}></label> 
            </div>
            <div className="wallet-nickname">{wallet.nickname || `Wallet ${wallet.id}`}</div>
            <div className="wallet-address" title={wallet.address}>{wallet.address}</div>
            <div className={`wallet-balance ${wallet.balance === 0 ? 'zero-balance' : ''}`}>
              {typeof wallet.balance === 'number' ? wallet.balance.toFixed(4) : '?.???'}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default WalletList;
